import React from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Container,
  Box,
  Grid,
  Paper,
} from "@mui/material";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import GitHubIcon from "@mui/icons-material/GitHub";
import { Link as ScrollLink, Element } from "react-scroll";
import "./HomePage.css"; // Assuming you have a separate CSS file for additional styles

// Import your background image (example path)
import backgroundImage from "./assets/background.jpg";

const theme = createTheme({
  palette: {
    primary: {
      main: "#1976d2",
    },
    secondary: {
      main: "#fff",
    },
  },
  typography: {
    h1: {
      fontSize: "3rem",
      fontWeight: 700,
      marginBottom: "1rem",
    },
    h2: {
      fontSize: "2rem",
      fontWeight: 500,
      marginBottom: "1rem",
    },
    body1: {
      fontSize: "1.25rem",
      marginBottom: "1.5rem",
    },
    button: {
      fontSize: "1rem",
      fontWeight: 600,
    },
  },
});

function HomePage() {
  return (
    <ThemeProvider theme={theme}>
      <AppBar
        position="sticky"
        sx={{ background: "linear-gradient(to right, #0d47a1, #42a5f5)" }}
      >
        <Toolbar>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            Resume Management Tool for LaTeX
          </Typography>
          <Button
            color="inherit"
            href="https://www.linkedin.com/in/yourprofile"
            target="_blank"
            rel="noopener noreferrer"
          >
            <LinkedInIcon />
          </Button>
          <Button
            color="inherit"
            href="https://github.com/yourprofile"
            target="_blank"
            rel="noopener noreferrer"
          >
            <GitHubIcon />
          </Button>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg">
        <Element name="section1" className="element">
          <Box
            className="first-box" // Add a class for specific styling
            textAlign="center"
            minHeight="100vh"
            display="flex"
            flexDirection="column"
            alignItems="center"
            justifyContent="center"
            backgroundImage={`url(${backgroundImage})`} // Apply background image
            backgroundSize="cover"
            backgroundPosition="center"
            color="#ffffff" // Text color for better contrast
            padding="2rem"
            marginBottom="2rem"
          >
            <Typography variant="h1" color="primary" gutterBottom>
              Welcome to the Resume Management Tool for LaTeX
            </Typography>
            <Typography variant="h2" color="textSecondary" gutterBottom>
              Simplify your resume creation process with our tool
            </Typography>
            <Typography variant="body1" color="textSecondary">
              Our tool helps you manage and generate new Latex CVs in seconds.
              Start exploring now!
            </Typography>
            <div style={{ display: "flex", gap: "1rem", marginTop: "2rem" }}>
              <Button
                variant="contained"
                color="primary"
                size="large"
                href="/tool"
              >
                Try now
              </Button>
              <ScrollLink
                to="section2"
                smooth
                duration={1000}
                style={{ textDecoration: "none" }}
              >
                <Button variant="contained" color="primary" size="large">
                  Learn More
                </Button>
              </ScrollLink>
            </div>
          </Box>
        </Element>

        {/* Rest of your sections */}
        {/* Section 2 */}
        <Element name="section2" className="element">
          {/* Grid layout for features */}
        </Element>

        {/* Section 3 */}
        <Element name="section3" className="element">
          {/* Documentation section */}
        </Element>

        {/* Section 4 */}
        <Element name="section4" className="element">
          {/* Try Now section */}
        </Element>

        {/* Footer */}
        <Box mt={5} textAlign="center">
          <Typography variant="body2" color="textSecondary">
            Â© 2024 Your Company Name. All rights reserved.
          </Typography>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default HomePage;
